import React, { Fragment } from 'react';
import { details } from "../../../data/details";

import "./style.scss";


const Content = () => {
    return (
        <div className="section">
            <div className="details">
                <div className="sub-title text-center section-header">Wedding Details</div>
                <br />
                {
                    details.map((detail, i) => (
                        <div className="detail-item">
                            <div className="detail-icon">
                                {detail.icon}
                            </div>
                            <div className="detail-title">
                                {detail.key}
                            </div>
                            <div className="detail-content">
                                {
                                    detail.children ?
                                        (
                                            detail.value.map((child, ind) => (
                                                <Fragment>
                                                    <div className="detail-content-key">{child.key}</div>
                                                    <div className="detail-content-address">{child.address}</div>
                                                    <a className="detail-content-link">{child.link}</a>
                                                </Fragment>

                                            ))
                                        )
                                        :
                                        (
                                            <div>{detail.value}</div>
                                        )
                                }
                            </div>
                        </div>
                    ))
                }
            </div>
        </div >
    );
};

export default Content;
